INSERT INTO `sys_article` (`id`, `title`, `alias`, `keywords`, `summary`, `content`, `original`, `copySite`, `copyURL`, `author`, `editor`, `createdDate`, `editedDate`, `status`, `type`, `views`, `sticky`, `order`, `private`, `users`, `groups`, `readers`) VALUES
	(1, 'welcome to our new OA system', '', 'OA', '', '<p>\n	一桥飞架南北，天堑变通途\n</p>\n<p>\n	<img src="/team/file-download-6.html" alt="" />\n</p>', '1', '', '', 'tim', 'tim', '2018-11-12 13:09:26', '2018-11-29 11:06:55', 'normal', 'blog', 4, '0', 0, '0', ',tim,', ',1,5,', 'tim'),
	(2, 'OA系统上线公告1112', '', '', '', '<p>\n	各位兄弟姐妹，公司内部第一版OA系统于今日正式上线，欢迎大家测试并提供宝贵建议。谢谢。\n</p>\n<p>\n	<br />\n</p>\n<p>\n	技术部\n</p>', '1', '', '', 'tim', '', '2018-11-12 13:17:07', '0000-00-00 00:00:00', 'normal', 'announce', 48, '0', 0, '0', '', '', 'tim,anson,winter,goslin,louise,libai,hunter,herge,ryan,admin,kim,osho,lee,doremi,koma,lillie,glory,annie,jae,loly,zack,eilleen1,arivn,samuel,baoer,kevin1,yoko,andy2,two,demi,beer'),
	(4, '公司年会表演节目征集', '', '', '', '<p>\n	<img src="/oa/file-download-4.html" alt="" />\n</p>\n<p>\n	email:&nbsp; kenson@nyjt88.com\n</p>', '1', '', '', 'goslin', 'goslin', '2018-11-26 17:25:46', '2018-11-26 17:26:24', 'normal', 'announce', 56, '0', 0, '0', '', '', 'goslin,julia,kim,tim,osho,lee,jae,doremi,koma,lillie,glory,kenson,annie,loly,anson,candy,eilleen1,zack,yann,arivn,samuel,baoer,tiger,ryan,hunter,kevin1,yoko,danny,daisy,andy2,xiaogang,two,aillie,adair,demi,beer'),
	(5, '然之协同系统使用帮助说明', '', '', '', '<p>\n	OA使用手册链接\n</p>\n<p>\n	<br />\n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/57.html" target="_blank">日常办公使用帮助</a> \n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/53.html" target="_blank">考勤操作帮助</a> \n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/announce-21.html" target="_blank">公告操作帮助</a>\n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/54.html" target="_blank">请假操作帮助</a>\n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/intro-project-127.html" target="_blank">项目管理使用帮助</a>\n</p>\n<p>\n	<a href="https://www.ranzhi.org/book/ranzhi/133.html" target="_blank">文档管理使用帮助</a> \n</p>', '1', '', '', 'goslin', 'goslin', '2018-11-28 10:14:20', '2018-11-28 10:14:42', 'normal', 'announce', 60, '0', 0, '0', '', '', 'goslin,tim,lee,admin,spark,colin,louise,koma,doremi,lillie,glory,annie,herge,loly,anson,fiona,candy,eilleen1,zack,yann,janfred,arivn,arno,samuel,baoer,bheng,ryan,hunter,danny,yoko,andy2,xiaogang,two,demi,beer'),
	(6, '劳动最光荣！', '', '劳动', '', '<img src="/team/file-download-7.html" alt="" />', '1', '', '', 'tim', '', '2018-11-29 14:05:06', '0000-00-00 00:00:00', 'normal', 'blog', 3, '0', 0, '0', ',goslin,julia,ryan,misaya,herge,', ',5,6,', 'tim'),
	(7, '请各位注意保管好考勤卡以及大楼电梯卡，切勿带入国内或者第三国', '', '', '', '<p>\n	<strong>Dear All，</strong>\n</p>\n<p>\n	<strong>临近年底，大家都有休假或者回国的计划，请各位注意以下事项，以避免可能出现的一些安装状况。</strong>\n</p>\n<p>\n	<strong>1、切勿将工作手机、工作笔记本及其他手持设备带回国内；</strong>\n</p>\n<p>\n	<strong>2、切勿将个人工卡以及大楼考勤卡带回国内或者其他第三国；</strong>\n</p>\n<p>\n	<strong>若回国休假，没有地方可以存放以上物品，可存放于各部门主管或者IT信息安全部。</strong>\n</p>\n<p>\n	<strong>若不慎将以上物品遗失在国内，会存在相当大的安全风险！</strong><strong>涉及个人人身财产安全问题，请大家给予重视！</strong>\n</p>\n<p>\n	<br />\n</p>', '1', '', '', 'robert', '', '2018-12-05 12:37:35', '0000-00-00 00:00:00', 'normal', 'announce', 15, '0', 0, '0', '', '', 'robert,andy2,goslin,koma,ben,janfred,glory,loly,anson,annie,two,candy,adair,beer,eilleen1,jae');
